choices.text:
COSBase base = acquireItem( j );
if( base instanceof COSInteger )
{
    result[j] = ((COSInteger)base).intValue();
}
else if( base instanceof COSFloat )
{
    result[j] = ((COSFloat)base).floatValue();
}
else
{
    throw new RuntimeException( "Error: Unknown type in PDF array" );
}

COSBase cosNumber = acquireItem( j );
if( cosNumber instanceof COSNumber )
{
    result[j] = ((COSNumber)cosNumber).floatValue();
}
else
{
    throw new RuntimeException( "Error: The item " + cosNumber + " is not a COSNumber." );
}

COSObject cosObject = get( j );
if( cosObject.isNumber() )
{
    result[j] = cosObject.getNumber().floatValue();
}

